import React from "react";
import "../styles/Panel.css";
import { useNavigate } from "react-router-dom";

function PanelTemplate({ title, rightContent, role }) {
    const navigate = useNavigate();
    const git = (page) => {
        navigate(`/manager/${page}`)
    }
    const managerL = () => {
        navigate('/login/manager');
    }
    return (
        <div className="panel-container">
            <div className="panel-left">
                <h2>{role == "manager" ? "ManagerPanel" : "EmployeePanel"}</h2>
                <form>
                    {role == "manager" && (
                        <>
                            <button onClick={() => git("employeeList")}>EmployeeList</button>
                            <button onClick={() => git("productList")}>ProductList</button>
                            <button onClick={() => git("orders")}>Orders</button>
                            <button onClick={() => git("salesReport")}>Sales Report</button>
                            <button onClick={managerL}>Manager Login</button>
                        </>
                    )}

                    {role == "employee" && (
                        <>
                            <button onClick={() => git("productList")}>ProductList</button>
                            <button onClick={() => git("orders")}>Orders</button>
                        </>
                    )}
                </form>
            </div>
            <div className="panel-right">
                <h2>{title}</h2>
                {rightContent}
            </div>
        </div>
    );
}

export default PanelTemplate;
